import React from 'react';
import unknownLogo from '../../assets/face.jpeg';

const LogoComponent = ({ user, width = '200', height = '200' }) => (
  <img src={user ? user.src : unknownLogo} alt='face' width={width} height={height} />
);

export default LogoComponent;
